import "./RecomItem.css";
const RecomItem = (props) => {
  return (
    <div className="div">
      <div>
        <img src={props.icon} alt="app name" />
        <label>{props.label}</label>
        <p>{props.category}</p>
      </div>
    </div>
  );
};

export default RecomItem;
